- ТОП-10 управленцев УрФО / ТОП-300 управленцев РФ (по итогам финала конкурса управленцев "Лидеры России" 2018-2019 гг. АНО "Россия - страна возможностей" при поддержке Президента РФ из 227 000 заявок 68 стран мира);
