- создатель НКО;  
- преподаватель института экономики и управления БУ ВО ХМАО - Югры «Сургутский государственный университет» (5-летний стаж: 14 дисциплин по 3 кафедрам);
- ученый, обладатель благодарственного письма Департамента образования и молодежной политики ХМАО – Югры "за успехи и высокие достижения в научно-исследовательской работе";
- член совета при Главе города по организации стратегического управления;
- руководитель «Сообщества инноваторов в управлении»;
- автор инновационных технологий, защищенных приказом о ноу-хау;
- соразработчик проекта и участник практики номинации "развитие инфраструктуры в формате ГЧП" конкурса "Лучшие муниципальные управленческие решения по формированию благоприятной инвестиционной среды" (1 место и благодарность Министра экономического развития РФ); 
- обладатель гранта по итогам конкурса проектов ХМАО - Югры (ГЧП);
- 3-кратный призер конкурса "Инициатива" при Главе города (внедрение авторских  разработок в систему управления социально-экономическим развитием города);
- 3-кратный обладатель премии "за выполнение особо важного и сложного задания" муниципальной службы (Администрация Сургута);
- победитель конкурса на включение в кадровый резерв на должность муниципальной службы для выполнения функции "руководитель";
- 25-кратный победитель и призер международных, всероссийских, региональных и городских научно-практических конференций и конкурсов по экономике и управлению (научная деятельность: Женева (Швейцария) - 1 место, Москва - дважды 1 место, Санкт-Петербург, Калининград, Гусев (Калининградская область), Новосибирск, Томск, Екатеринбург, Ханты-Мансийск, Сургут);
- автор законодательных инициатив по экономике и управлению федерального, регионального и муниципального уровней;
- автор более 20 инвестиционных проектов (включая концепции, в т.ч. ГЧП и МЧП);
- автор более 10 методик и технологий социально-экономического развития (в т.ч. ГЧП и МЧП); 
- член рабочей группы по векторам "бизнес", "инновации" и "промышленность" и докладчик публичных слушаний стратегии социально-экономического развития Сургута; 
- докладчик заседания постоянного комитета Думы города по городскому хозяйству и перспективному развитию города Сургута;
- более чем 100-кратный участник форумов и семинаров по социально-экономическому развитию;
- автор 13 научных статей (и 2 публицистических);
- именной стипендиат и обладатель премии Губернатора ХМАО – Югры;
- участник курсов повышения квалификации (в т.ч. 72 часа по темам "ГЧП" ("Внешэконмбанк" и "Финансовый университет при Правительстве РФ") и "Управление муниципальным имуществом").

